import React from 'react';
import styled from 'styled-components';

const CollectionPreview = ({ title, items }) => {
	return (
		<div>
			<h1>{title}</h1>
			<div>
				{items.slice(0, 4).map(({ id, name }) => (
					<div key={id}>{name}</div>
				))}
			</div>
		</div>
	);
};

export default CollectionPreview;
